import React from 'react';
import Navbar from './components/navbar';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
      <navbar />
      <Routes>
        <Route path = '/' exact />
      </Routes>
    </Router>
  );
}

export default App;
